import { useEffect, useState } from "react"

export default function Users(){

    function DeleteUsers(){
        
    }
    const [users,setusers]=useState([])
    useEffect(()=>{
        fetch("http://127.0.0.1:8000/api/user/show")
        .then(res=>res.json())
        .then(data=>setusers(data))
    },[])
    const ShowUsers=users.map((user,index)=>
    <tr>
      <td>{index+1}</td>
      <td>{user.name}</td>
      <td>{user.email}</td>
      <td>
        <i onClick={DeleteUsers} className="fa-solid fa-pen-to-square"style={{color:"#74afb9",paddingRight:"20px",cursor:"pointer"}} ></i>
        <i className="fa-solid fa-trash"style={{color:"red",cursor:"pointer"}}></i>
      </td>


      </tr>
        
    )
    return(
        <table >
            <thead>
                <th>Id</th>
                <th>Users</th>
                <th>Email</th>
                <th>Acction</th>
                
            </thead>
            <tbody>
            
             {ShowUsers}
               
         
            </tbody>
        </table>
    )
}
